import React from "react";

import "./card1.scss";

type Props = JSX.IntrinsicElements["div"] & {
  title?: string;
  text?: string;
  data?: string;
  store?: any;
};

const Card1: React.FC<Props> = ({ title, text, store, data, ...rest }) => {
  return (
    <div className="card1" {...rest}>
      <div className="card1-image">
        <div
          onClick={(e) => {
            store?.CardsDelete(data);
          }}
        >
          delete
        </div>
        <h1>Çalışmaya Başla</h1>
        <img className="bottom-arrow" src="/bottom.svg" alt="" />
      </div>
      <div className="card1-description">
        <h5> {title ? title : "default"} </h5>
        <p>{text ? text : " "}</p>
      </div>
    </div>
  );
};

export default Card1;
